import React from "react";
import { connect } from "react-redux";
const MySelect = (props) =>{
	return(
		<div>
				<select>
					<option  value="value">{props.random}</option>
					<option selected value="value">{props.byName}</option>
				</select>
			</div>
	)
}
const mapStateToProps = (state) => ({
	random: state.usersPage.options.random,
	byName: state.usersPage.options.byName,
})
export default connect(mapStateToProps,)(MySelect);
